import { Component } from '@angular/core';

@Component({
  selector: 'app-cservicios',
  templateUrl: './cservicios.component.html',
  styleUrls: ['./cservicios.component.css']
})
export class CserviciosComponent {

}
<nav>
    <ul class="btn btn-primary">

       <a class="btn btn-primary" routerLink="/servicios">Servicios</a>
       <a class="btn btn-primary" routerLink="/acceso">Acceso</a>


    </ul>
</nav>

<div routerLink="/acceso" class="w-50 p-3 h-50 d-inline-block">
    <img src="https://homomedicus.com/wp-content/uploads/2023/01/rehabilitacion-en-pacientes-con-epoc.jpg" alt="">

</div>
